import {Navbar,Container} from 'react-bootstrap';
import './projectnavbar.css';
function ProjectNavBar()
{
    return (
    <Navbar className='projectNavBar'>
        <Container className='projectNavBarContainer'>
            <Navbar.Brand className='project' href='#Home'>Overview</Navbar.Brand>
            <Navbar.Brand className='project' href=''>List</Navbar.Brand>
            <Navbar.Brand className='project' href=''>Timeline</Navbar.Brand>
            <Navbar.Brand className='project' href=''>Calendar</Navbar.Brand>
            <Navbar.Brand className='project' href='#Dashboard'>Dashboard</Navbar.Brand>
            <Navbar.Brand className='project' href=''>More</Navbar.Brand>
        </Container>
    </Navbar>
    );
}

export default ProjectNavBar;
